import React, { Component } from 'react';
import vegetableData from '../data/vegetableData.json';
import HeaderTemplate from './billingPage/templates/HeaderTemplate';
import BillingMain from './billingPage/templates/BillingMain';
import ServiceTemplate from './billingPage/templates/ServiceTemplate';
import Foot from './billingPage/UI/organisms/footer/Foot';
import { ValueProvider } from './billingPage/Context';

class BillingPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
            vegetableData: vegetableData,
            cart: {
                count: 0,
                mrp: 0,
                total: 0
            }
        }
    }

    render() {
        return (
            <>
                <ValueProvider value={{
                    items: this.state.items,
                    cart: this.state.cart
                }}>
                    <HeaderTemplate />
                    <BillingMain />
                </ValueProvider>
                <ServiceTemplate />
                <Foot />
            </>
        )
    }
}

export default BillingPage
